import React from "react";
import {
  View,
  Text,
  StyleSheet,
  Image,
  TouchableOpacity,
  ScrollView,
  FlatList,
} from "react-native";

const Orders = (props) => {
  return (
    <View style={styles.Container}>
      <Text>Orders</Text>
    </View>
  );
};

const styles = StyleSheet.create({});

export default Orders;
